		"html": "<div class=\"title mt10\">Item Markings</div> <div class=\"mb10\"></div>\n<div><span class='eiteml'></span> Left bottom corner indicates the item level</div>\n<div><span class='eitemll'></span> The color changes with higher levels</div>\n<div><span class='eitemq'></span> Right bottom corner indicates the item quantity</div>\n<div><span class='eitemqp'></span> HP / MP potions have special quantity colouring</div>\n<div><span class='eitemm'></span> M: Items received from the Merchant's Luck buff</div>\n<div><span class='eitempvp'></span> ^: PVP marked item, can be dropped on death</div>\n<div><span class='eitemsell'></span> $: A \"Want to Sell\" item listing</div>\n<div><span class='eitembuy'></span> ?: A \"Want to Buy\" item listing</div>\n<div><span class='eitemga'></span> @: A giveaway item</div>\n<div><span class='eitemlo'></span> X: Locked items can't be unintentionally sold/upgraded</div>\n<div><span class='eitemls'></span> S: Sealed items take 7 days to be unlocked</div>\n<div><span class='eitemlu'></span> U: Indicates an unlocking item</div>\n\n<div class=\"divider\"></div>\n<div class=\"title mt15\">Item Upgrades</div> <div class=\"mb5\"></div>\n<div>Weapons and Armor start at +0 and they can be upgraded until +10. +10 is almost an impossibility. At each upgrade, there's a chance of item loss. There are 3 grades of items, Low, High and Rare and 3 grades of upgrade scrolls.</div>\n\n<div style='line-height: 50px; margin-top: 10px'><span class='eitemup0'></span> + <span class='eitemscr0'></span> => <span class='eitemup1'></span></div>\n\n<div class=\"divider\"></div>\n<div class=\"title mt15\">Item Compounds</div> <div class=\"mb5\"></div>\n<div>3 Accessories can be combined for a chance to acquire a higher level accessory.</div>\n\n<div style='line-height: 50px; margin-top: 10px'><span class='eitemco0'></span> + <span class='eitemco0'></span> + <span class='eitemco0'></span> + <span class='eitemcscr0'></span> => <span class='eitemco1'></span></div>\n\n<div class=\"divider\"></div>\n<div class=\"title mt15\">Item Exchanges and Quests</div> <div class=\"mb5\"></div>\n<div>Some items can be exchanged for random rewards. Gems and armor, weapon boxes are some examples. Xyn in Town handles most exchanges. Items like seashells and leathers can be exchanged from their quest NPC's.</div>\n\n<div style='line-height: 50px; margin-top: 10px'><span class='eitemex0'></span> => <span class='eitemexo00'></span> or <span class='eitemexo01'></span> or <span class='eitemexo02'></span> or ... </div>\n<div style='line-height: 50px; margin-top: 10px'><span class='eitemex1'></span> => <span class='eitemexo10'></span> or <span class='eitemexo11'></span> or ... </div>\n\n<style>\n\t.title{\n\t\tcolor: #406944;\n\t\tfont-size: 36px;\n\t\tmargin-top: 15px;\n\t}\n\t.divider{\n\t\tmargin-top: 15px;\n\t\theight: 5px;\n\t\tbackground-color: gray;\n\t\tmargin-left: -26px;\n\t\tmargin-right: -26px;\n\t}\n</style>\n\n<script>\n\t$(\".eiteml\").html(item_container({skin:G.items.blade.skin},{name:\"blade\",level:5}));\n\t$(\".eitemll\").html(item_container({skin:G.items.harbringer.skin},{name:\"harbringer\",level:8}));\n\t$(\".eitemq\").html(item_container({skin:G.items.seashell.skin},{name:\"seashell\",q:40}));\n\t$(\".eitemqp\").html(item_container({skin:G.items.hpotx.skin},{name:\"hpotx\",q:88}));\n\t$(\".eitemm\").html(item_container({skin:G.items.suckerpunch.skin},{name:\"suckerpunch\",m:true}));\n\t$(\".eitempvp\").html(item_container({skin:G.items.gem1.skin},{name:\"gem1\",v:true,q:12}));\n\t// Trade\n\t$(\".eitemsell\").html(item_container({skin:G.items.woodensword.skin,trade_for_ui:true},{name:\"woodensword\",level:9}));\n\t$(\".eitembuy\").html(item_container({skin:G.items.fury.skin,trade_for_ui:true},{name:\"fury\",b:true}));\n\t$(\".eitemga\").html(item_container({skin:G.items.starkillers.skin,trade_for_ui:true},{name:\"starkillers\",giveaway:true}));\n\t// Locking\n\t$(\".eitemlo\").html(item_container({skin:G.items.wblade.skin},{name:\"wblade\",l:\"l\"}));\n\t$(\".eitemls\").html(item_container({skin:G.items.xgloves.skin},{name:\"xgloves\",l:\"s\"}));\n\t$(\".eitemlu\").html(item_container({skin:G.items.xpants.skin},{name:\"xpants\",l:\"u\"}));\n\t// Upgrades\n\t$(\".eitemup0\").html(item_container({skin:G.items.helmet.skin},{name:\"helmet\",level:0}));\n\t$(\".eitemup1\").html(item_container({skin:G.items.helmet.skin},{name:\"helmet\",level:1}));\n\t$(\".eitemscr0\").html(item_container({skin:G.items.scroll0.skin},{name:\"scroll0\"}));\n\t// Compounds\n\t$(\".eitemco0\").html(item_container({skin:G.items.hpamulet.skin},{name:\"hpamulet\",level:0}));\n\t$(\".eitemco1\").html(item_container({skin:G.items.hpamulet.skin},{name:\"hpamulet\",level:1}));\n\t$(\".eitemcscr0\").html(item_container({skin:G.items.cscroll0.skin},{name:\"cscroll0\"}));\n\t// Exchanges\n\t$(\".eitemex0\").html(item_container({skin:G.items.armorbox.skin},{name:\"armorbox\"}));\n\t$(\".eitemexo00\").html(item_container({skin:G.items.gloves.skin},{name:\"gloves\"}));\n\t$(\".eitemexo01\").html(item_container({skin:G.items.harmor.skin},{name:\"harmor\"}));\n\t$(\".eitemexo02\").html(item_container({skin:G.items.xgloves.skin},{name:\"xgloves\"}));\n\t$(\".eitemex1\").html(item_container({skin:G.items.leather.skin},{name:\"leather\",q:40}));\n\t$(\".eitemexo10\").html(item_container({skin:G.items.cape.skin},{name:\"cape\"}));\n\t$(\".eitemexo11\").html(item_container({skin:G.items.bcape.skin},{name:\"bcape\"}));\n</script>",
